// ComingSoon.js

import React from 'react';
import './styles/comming-soon.css'

const ComingSoon = () => {

  return (
    <div className="coming-soon">
      <h1>Coming Soon</h1>
      <p>We are working hard to bring something amazing. Stay tuned!</p>
    </div>
  );
};

export default ComingSoon;
